import React, { useState } from 'react'

function TodoForm() {
  const [input, setInput] = useState('')

  const onSubmit = (e) => {
    e.prevendDefault()
  }

  return (
    <form onSubmit={onSubmit}>
      <input type="text" placeholder="Add item" value={input} name="text" />
      <button>ADD</button>
    </form>
  )
}

export default TodoForm
